import React from 'react';

const Background = () => {

    return(
        <div>
            <img style={{background_size: 'cover', background_position: 'center'}} className="bg" src="https://images.unsplash.com/photo-1516100413948-27235ca6990e?ixid=MXwxMjA3fDB8MHxzZWFyY2h8MXx8b2xkJTIwdHJhZmZvcmR8ZW58MHx8MHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=800&q=60" alt="img"></img>
        </div>
    )
}

export default Background;
